सशस्त्र प्रहरी बल नेपालका महानिरीक्षक राजु अर्यालले आसन्न प्रतिनिधिसभा सदस्य निर्वाचनलाई निश्पक्ष, भयरहित र शान्तिपूर्ण वातावरणमा सम्पन्न गराउन आवश्यक सुरक्षा सतर्कता अपनाउन वरिष्ठ अधिकृतहरुलाई निर्देशन दिएका छन् ।&amp;nbsp;
&amp;nbsp;
