भक्तपुरको एक फर्निचर उद्योगमा आगलागी हुँदा रु ३५ लाख बराबरको सामान नष्ट भएको छ ।&amp;nbsp;
&amp;nbsp;&amp;nbsp; &amp;nbsp;
